ition)</strong> wykonywane jest <em>przejĹcie do kÄta horyzontalnego</em>. NastÄpnie jedna noga dĹşwigana jest do <strong>pozycji fishtail (Fishtail).</strong> Noga horyzontalna przenoszona jest szybkim ruchem po Ĺuku 180<sup>o</sup>, w czasie gry noga pionowa opuszczana jest do przodu, aby osiÄgnÄÄ <strong>pozycje szpagatowÄ (Split Position),</strong> a nastÄpnie wykonuje siÄ rotacjÄ w biodrach o 180<sup>o</sup> i przednia noga dĹşwigana jest do <strong>pozycji fishtail (Fishtail).</strong> Noga horyzontalna dĹşwigana jest do <strong>pozycji pionowej (Vertical)</strong> w tym samym tempie co poczÄtkowe fazy figury, a nastÄpnie odbywa siÄ <em>pionowe zanurzenie (Vertical Descent).</em></p>\r\n\r\n<p><img alt="" height="167" src="http://ankiety.wulkanizacja-szczuczyn.pl/js/ckfinder/userfiles//images/figura%201.png" width="651" /></p>\r\n', '', '', 0, 1),
