(128, '0000-00-00 00:00:00', 28, 1, 0, 'CZÄĹÄ IV â B  OPIS FIGURY: From a Front Layout Position a Front Pike Position is assumed. One leg is lifted to a Fishtail Position. Maintaining the angle between the legs, the horizontal leg moves to vertical as the vertical leg simultaneously continues its arc to the surface to assume a Knight Position. Maintaining the vertical alignment of the body, the horizontal leg is moved in a 1800 arc at the surface of the water to a Fishtail Position. The horizontal leg is lifted to the Vertical Position. A Vertical Descent is executed.  Z pozycji podstawowej na piersiach (Front Layout Position) wykonywane jest przejĹcie do kÄta horyzontalnego. Jedna noga dĹşwigana jest do pozycji fishtail (Fishtail). UtrzymujÄc kÄt miÄdzy nogami przenoszone sÄ one do pozycji wieĹźy (Knight) w ten sposĂłb, Ĺźe noga horyzontalna dĹşwigana jest do pionu, w czasie gdy noga pionowa przenoszona jest do tyĹu. UtrzymujÄc pionowe ustawienie ciaĹa, noga horyzontalna przenoszona jest po Ĺuku 180o do przodu, aby osiÄgnÄÄ pozycjÄ fishtail (Fishtail). Noga horyzontalna dĹşwigana jest do pionu (Vertical) i nastÄpujÄ pionowe zanurzenie (Vertical Descent).', '<p><strong><u>CZÄĹÄ IV &ndash; B</u></strong></p>\r\n\r\n<p style="text-align: justify;"><u>OPIS FIGURY:</u> From a <strong>Front Layout Position </strong>a <em>Front Pike Position is assumed</em>. One leg is lifted to a <strong>Fishtail Position</strong>. Maintaining the angle between the legs, the horizontal leg moves to vertical as the vertical leg simultaneously continues its arc to the surface to assume a <strong>Knight Position</strong>. Maintaining the vertical alignment of the body, the horizontal leg is moved in a 1800 arc at the surface of the water to a <strong>Fishtail Position. </strong>The horizontal leg is lifted to the <strong>Vertical Position. </strong>A <em>Vertical Descent </em>is executed.</p>\r\n\r\n<p style="text-align: justify;">Z <strong>pozycji podstawowej na piersiach (Front Layout Position)</strong> wykonywane jest <em>przejĹcie do kÄta horyzontalnego</em>. Jedna noga dĹşwigana jest do <strong>pozycji fishtail (Fishtail). </strong>UtrzymujÄc kÄt miÄdzy nogami przenoszone sÄ one do <strong>pozycji</strong> <strong>wieĹźy (Knight)</strong> w ten spos&oacute;b, Ĺźe noga horyzontalna dĹşwigana jest do pionu, w czasie gdy noga pionowa przenoszona jest do tyĹu. UtrzymujÄc pionowe ustawienie ciaĹa, noga horyzontalna przenoszona jest po Ĺuku 180<sup>o</sup> do przodu, aby osiÄgnÄÄ <strong>pozycjÄ fishtail (Fishtail).</strong> Noga horyzontalna dĹşwigana jest do <strong>pionu (Vertical)</strong> i nastÄpujÄ <em>pionowe zanurzenie (Vertical Descent).</em></p>\r\n\r\n<p style="text-align: justify;"><img alt="" height="170" src="http://ankiety.wulkanizacja-szczuczyn.pl/js/ckfinder/userfiles//images/figura%202.png" width="690" /></p>\r\n', '', '', 0, 1),
